    data: |
      SELECT DISTINCT - + col0 + 10 AS col1 FROM tab2 (FORMAT parquet) cor0 WHERE col1 * + 76 NOT IN ( - col0 + - col1, col1, col1 );
  - name: tab2

outputs:
  - name: q10196.out
    data: |
      -36
      -54
      -65
